\[
\cos \left( \frac{2 \pi}{15} \right) \cos \left( \frac{4 \pi}{15} \right) \cos \left( \frac{8 \pi}{15} \right) \cos \left( \frac{14 \pi}{15} \right).
\]

Next, we use the identity for the product of cosines of angles that are in arithmetic progression. Specifically, we use the identity for the product of cosines of the angles \(\frac{2k\pi}{2n+1}\) for \(k=1, 2, \ldots, n\):

\[
\prod_{k=1}^n \cos \left( \frac{2k\pi}{2n+1} \right) = \frac{1}{2^n}.
\]

In our case, we have \(n=3\) and the angles are \(\frac{2\pi}{15}\), \(\frac{4\pi}{15}\), \(\frac{6\pi}{15}\), and \(\frac{8\pi}{15}\), but we need to include \(\frac{14\pi}{15}\) instead of \(\frac{6\pi}{15}\). However, we can use the fact that \(\cos \left( \frac{6\pi}{15} \right) = -\cos \left( \pi - \frac{6\pi}{15} \right) = -\cos \left( \frac{9\pi}{15} \right) = -\cos \left( \frac{3\pi}{5} \right)\) and \(\cos \left( \frac{14\pi}{15} \right) = -\cos \left( \pi - \frac{14\pi}{15} \right) = -\cos \left( \frac{\pi}{15} \right)\). Therefore, we have:

